export const SearchResultsRow = ({key, house}:{key:any, house:any}) => {
    const setActive = () => {}
  return (
    <tr onClick={setActive}>
        <td>{house.address}</td>
        <td>{house.photo}</td>
        <td>{house.likes}</td>
    </tr>
  )
};

export default SearchResultsRow;
